eval("/* harmony default export */ __webpack_exports__[\"a\"] = ({\n    returnCode: 1000,\n    datainfo: {\n        \"105281621947653241\": { id: '105281621947653241', name: \"大数据与人工智能产品部销售总监\", location: \"深圳\", number: 1, responsibilities: \"<p>负责公司大数据与人工智能产品对应行业客户的开拓、客户关系维护，面向的行业包括政府、制造业企业、零售业、银行、券商、运营商等；</p><p>结合公司大数据与人工智能产品，完成相关解决方案的制定、更新与市场方案交流、讲标等工作；</p><p>完成公司大数据与人工智能产品部销售签单与回款的经营结果的达成。</p>\", require: \"<p>全日制统招本科以上学位，专业不限，211或985学校计算机或营销相关专业毕业者优先；</p><p>3年以上大数据、人工智能领域的业务销售或产品经验，熟悉大数据标签体系、用户画像、大数据平台、大数据精准营销等相关产品；有突出的成功销售经验，善于和客户沟通、维护客户关系并促成业绩达成，能对经营结果负责；</p><p>逻辑思维能力强，具备较好的产品理解力、协调能力、较强的抗压能力，能组织相关资源达成结果；</p><p>有行业客户资源者优先。</p>\" },\n        '105281621947653242': { id: '105281621947653242', name: \"技术总监\", location: \"深圳、武汉\", number: 2, responsibilities: \"<p>统领技术团队，带领一或多条产品线整个技术团队完成需求与客户沟通、产品开发、核心项目交付等全流程工作； </p><p>带领团队完成产品的技术决策，技术选型、技术架构和技术风险评估等工作，并对产品的详细设计、开发以及单元测试、相关技术资料编写进行把控，组织完成核心技术问题的攻关，负责技术人员的整体管理、培训、激励、能力提升、梯队建设等工作。</p>\", require: \"<p>211或985学校计算机、软件相关专业本科以上学历；</p><p>6年以上软件开发经验，3年以上研发团队管理经验，有独立带领技术团队开发软件产品的成功案例，具备带领50人以上大型技术团队经验者优先；</p><p>精通Java语言，熟悉CSS、HTML等程序语言，熟悉APP、H5等的管理、设计规划、前台制作、后台程序制作与数据库管理流程，精通主流数据库； </p><p>有电商O2O、银行业务软件、产业园区、政务信息系统或其他大企业软件开发经验者优先；</p><p>具备突出的沟通能力、良好的管理与协调能力、较强的抗压能力和自我驱动力，对工作有热情，能在高速成长的新兴互联网公司下带领技术团队快速突破、完成产品研发与大项目交付。</p>\" },\n        '105281621947653243': { id: '105281621947653243', name: \"新业务运营经理\", location: \"深圳\", number: \"不限\", responsibilities: \"<p>负责公司在工业互联网领域产品业务的落地运营工作，包括客户沟通、需求调研与对接、合同回款等商务流程管控等； </p><p>负责公司在B2B供应链领域内的运营落地工作，包括上下游客户沟通、业务对接、合同回款等商务流程管控等；</p><p>完成事业部总经理交予的其他运营工作。</p>\", require: \"<p>全日制统招本科以上学位，专业不限，法律、商学、外贸等人文社会科学专业优先，211或985学校学历者优先；</p><p>3年以上商务或运营工作经验，有工业互联网或B2B供应链业务领域经验者优先；</p><p>具备良好的沟通能力、协调能力、较强的抗压能力和自我驱动力，对工作有热情，能在高速成长的新兴互联网公司下完成业务落地与运营结果交付。</p>\" },\n        '105281621947653244': { id: '105281621947653244', name: \"方案经理\", location: \"深圳\", number: \"不限\", responsibilities: \"<p>负责运营商项目的方案及投标文件的撰写、投标、解决方案宣讲工作；</p><p>负责挖掘项目需求，数据挖掘分析，包括售前PPT、方案支持；</p><p>负责新项目的前期引导，评分点的把控及客户沟通；</p><p> 负责清晰梳理自有方案进行客户宣讲培训和内部培训。</p><p>上级领导交代的其他临时工作事项。</p>\", require: \"<p>大专及以上学历，2年以上工作经历，具有互联网经验优先；</p><p>熟练使用PPT、Word、EXCEL等办公软件；</p><p>具备卓越的逻辑分析能力，思维清晰敏捷，较强的整理能力和归纳总结能力；</p><p>具备良好的方案撰写能力，宣讲能力，及较强的语言沟通能力。</p>\" },\n        '105281621947653245': { id: '105281621947653245', name: \"贵阳办事处项目经理\", location: \"贵阳\", number: 1, responsibilities: \"<p>对项目的销售、收入、收款以及利润等经营指标负责以及项目团队的组织管理负责。</p> <p>项目管理：能够积极理清项目需求，组建团队合理分工，制定项目计划，有效执行落地项目； </p><p>客户关系管理：以我司平台为基础，同客户长期交流，达成合理产品规划，协调内部团队完成项目； </p><p>负责当地市场的市场开拓，市场分析、用户分析、产品竞争力和策略分析，撰写分析报告，完成公司其他工作安排；</p>\", require: \"<p>大专及以上学历，二年以上互联网行业策划运营或项目经理工作经验，自认为能够胜任岗位职责所需； </p><p>具备较强的项目管理能力、沟通协调能力和执行力，有电子商务类产品运营经验优先； </p><p>有较强的商务谈判能力，能与政府、企业等进行合作洽谈； </p><p>具备较强的文案功底，能完成项目管理流程、合同协议等的撰写； </p><p>具备较强的移动互联网行业敏感度，和良好的产品规划能力； </p><p>具备较强的逻辑思维、需求分析及文档表达宣讲能力； </p><p>具备很强的沟通协调能力，能承担一定的工作压力；</p><p>具有运营商业务、终端销售等背景者优先； </p><p>有运营商电子渠道工作经验优先； </p><p>具备较强的PPT撰写能力。</p>\" },\n        '105281621947653246': { id: '105281621947653246', name: \"运营经理\", location: \"深圳\", number: \"不限\", responsibilities: \"<p>负责公司移动端平台的运营管理工作，运营团队的组建；</p><p>负责APP产品规划、市场推广、产品及促销活动的制定和实施，确保完成每月运营指标；</p><p>负责产品运营数据分析和市场状况分析，根据分析结果指导运营策略制定和实施，提高客户体验度；</p><p>负责项目的整体规划和专题活动的策划制定、执行、评估及改进，有效提升用户活跃度及新用户数量；</p><p>分析和总结竞争对手、行业信息，公司产品信息调研等，形成调研报告，为公司的整体发展战略提供依据；</p><p>整理分析运营各项需求和数据，及时撰写运营分析报告，并提出合理化可行性建议。</p>\", require: \"<p>大专以上学历，3年以上工作经验；</p><p>对互联网事物，网络营销事件高度敏感，具备良好的理解、表达和沟通的能力，超强的执行力，以及较强的逻辑思维、调研及分析能力；</p><p>具有娴熟的运营策划技能和丰富的专业知识，有运营成功案例者优先。</p>\" },\n        '105281621947653247': { id: '105281621947653247', name: \"中级HTML5工程师（武汉）\", location: \"武汉\", number: \"不限\", responsibilities: \"<p>开发基于Html5的网页前端开发，适配多种浏览器。</p><p>负责公司移动端（app）的静态页面设计更新与美观优化；</p><p>负责各项目用户交互界面设计，和开发团队共同创建用户界面，跟踪产品效果，提出设计、改善方案。</p>\", require: \"<p>大专以上，精通HTML5编程，有2年以上HTML5开发经验；</p><p>深刻理解W3C WEB标准，熟悉HTML5及CSS3特性，(包括localStorage /Application Cache /CSS 3.0标准)，对可用性、可访问性等相关知识有实际的应用；</p><p>熟悉Javascript语言的各特性，有js性能优化的实践经验；</p><p>熟悉Css3/Javascript，熟练使用jquery /jqtouch /jquerymobile等流行框架之一，熟悉Ajax开发模式；</p><p>熟悉angular  ionc优先；</p><p>对app产品有一定了解；</p><p>具备微信二次开发经验者优先。</p>\" },\n        '105281621947653248': { id: '105281621947653248', name: \"中高级Java开发工程师（武汉）\", location: \"武汉\", number: \"不限\", responsibilities: \"<p>参与需求评审；系统和数据库设计工作及完善相关的文档；</p><p>完成模块，接口和服务等开发编码工作；</p><p>按项目要求保质保量交付任务；</p><p>参与核心模块的设计与开发。</p>\", require: \"<p>本科及以上学历，3年以上工作经验，Java基础扎实，有高并发大流量后台架构及开发经验者优先；</p><p>熟悉Spring-boot、SpringMVC、Spring-data、cxf等框架；</p><p>精通Maven使用，Git代码管理；熟悉Nginx/Tomcat；</p><p>熟悉J2EE编程相关技术和框架（包括Java语言/Struts /Spring /iBatis /hibernet等）；</p><p>熟悉Linux下的常用命令和Shell编程；</p><p>熟练使用mysql数据库，有mysql管理、优化经验者优先；</p><p>至少熟悉一种内存数据库，例如：Memcache、Redis、MangoDB等；</p><p>熟练掌握html，xml，css，javascript，jquery，ajax，json等前端开发技术，并能处理各浏览器及各设备兼容问题；</p><p>熟悉消息中间件，RPC框架，数据层缓存，性能优化等相关技术；</p><p>有电商经验优先。 能适应较大的工作压力，有强烈的责任感和良好的沟通能力。</p>\" }\n    }\n});\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///160\n");

